import React from "react";
import "./styles.scss";

const Home = () => {
    return (
        <>
            <div className="contentHome">
                <nav className="wrap_nav_video">
                    <div className="menu">
                        <ul>
                            <h1>Home</h1>
                        </ul>
                    </div>
                </nav>
            </div>
        </>
    )
}
export default Home;
